    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        foreach ($this->movies as $movie) {
            DB::table('movies')->insert([
                'id' => $movie['id'],
                'imdb_id' => $movie['imdb_id'],
                'title' => $movie['title'],
                'original_title' => $movie['original_title'],
                'tagline' => $movie['tagline'],
                'overview' => $movie['overview'],
                'release_date' => $movie['release_date'],
                'poster_path' => $movie['poster_path'],
                'backdrop_path' => $movie['backdrop_path'],
                'purchase_date' => $movie['purchase_date'] ?: null,
                'certification_id' => $movie['certification'],
                'runtime' => $movie['runtime'],
            ]);

            foreach ($movie['genres'] as $genre) {
                DB::table('genre_movie')->insert([
                    'movie_id' => $movie['id'],
                    'genre_id' => $genre['id'],
                ]);
            }

            $order = 0;

            foreach ($movie['cast'] as $cast_member) {
                if (! DB::table('cast_members')->find($cast_member['id'])) {
                    DB::table('cast_members')->insert([
                        'id' => $cast_member['id'],
                        'name' => $cast_member['name'],
                        'original_name' => $cast_member['original_name'],
                        'profile_path' => is_null($cast_member['profile_path']) ? '' : $cast_member['profile_path'],
                    ]);
                }

                DB::table('cast_member_movie')->insert([
                    'cast_member_id' => $cast_member['id'],
                    'movie_id' => $movie['id'],
                    'character' => $cast_member['character'],
                    'order' => $order,
                ]);

                $order++;
            }
        }
    }
